import React from "react";

function ToolCard({ tool }) {
  return (
    <div className="tool-card">
      <h2>{tool.name}</h2>
      <p>{tool.description}</p>
      <a href={tool.url} target="_blank" rel="noopener noreferrer">Acessar ferramenta</a>
    </div>
  );
}

export default ToolCard;
